long get_file_size(const char *path)
{
	long filesize = -1;
	FILE *fp;
	fp = fopen(path, "r");
	if (fp == NULL)
		return filesize;
	fseek(fp, 0L, SEEK_END);
	filesize = ftell(fp);
	fclose(fp);
	return filesize;
}



int read_lead_data(char* file_name, float* ecg_data)
{
	FILE *pfile = NULL;
	pfile = fopen(file_name, "rb");

	fseek(pfile, 0, SEEK_END);
	int32_T nFileLen = ftell(pfile);

	fseek(pfile, 0, SEEK_SET);

	fread(ecg_data, 4, nFileLen/4 , pfile);
	fclose(pfile);
	return 0;
}

int read_r_poses(char* file_name, int* r_pos_buf)
{
	FILE *pfile = NULL;
	pfile = fopen(file_name, "rb");

	fseek(pfile, 0, SEEK_END);
	int32_T nFileLen = ftell(pfile);
	fseek(pfile, 0, SEEK_SET);

	fread(r_pos_buf, 4, nFileLen / 4, pfile);
	fclose(pfile);
	return 0;
}

int read_r_noise_flags(char* file_name, bool* r_noise_buf)
{
	FILE *pfile = NULL;
	pfile = fopen(file_name, "rb+");

	fseek(pfile, 0, SEEK_END);
	int32_T nFileLen = ftell(pfile);
	fseek(pfile, 0, SEEK_SET);

	int * label_noise_arr = new int[nFileLen / 4];

	fread(label_noise_arr, 4, nFileLen / 4, pfile);
	fclose(pfile);

	for (int i = 0; i < nFileLen / 4; i++)
	{
		r_noise_buf[i] = label_noise_arr[i];
	}
	delete[] label_noise_arr;

	return 0;
}


void test_PT_Detect()
{
	char lead_II_file[] = "E:\\matlabWorkspace\\detect_PT_peaks\\testdata\\周林新\\out_II_data.dat";
	char r_pos_file[] = "E:\\matlabWorkspace\\detect_PT_peaks\\testdata\\周林新\\out_merge_r_pos.dat";
	char r_noise_flag_file[] = "E:\\matlabWorkspace\\detect_PT_peaks\\testdata\\周林新\\out_r_noise_flag.dat";
	char r_start_end_file[] = "E:\\matlabWorkspace\\detect_PT_peaks\\testdata\\周林新\\out_qrs_start_ends.dat";

	unsigned long rfile_size = get_file_size(r_pos_file);
	int r_pos_len = rfile_size / 4;
	int * r_pos_arr = new int[r_pos_len];
	bool * r_noise_flag_arr = new bool[r_pos_len];
	read_r_poses(r_pos_file, r_pos_arr);
	read_r_noise_flags(r_noise_flag_file, r_noise_flag_arr);

	
	unsigned long lead_II_file_size = get_file_size(lead_II_file);
	int data_len = lead_II_file_size / 4;
	float* lead_data = new float[data_len];
	read_lead_data(lead_II_file, lead_data);

	int t_pos_num = 0;
	int p_pos_num = 0;
	int * t_pos_arr = new int[data_len];
	int * p_pos_arr = new int[data_len];

	int * start_end_arr = new int[r_pos_len ];
	read_r_poses(r_start_end_file, start_end_arr);

	float * rr_noise_levels = new float[r_pos_len ];


	PT_longterm(lead_data, data_len , r_pos_arr, (short int *)start_end_arr, r_noise_flag_arr, r_pos_len, 256, t_pos_arr, &t_pos_num, p_pos_arr, &p_pos_num, rr_noise_levels);

	delete[] r_pos_arr;
	delete[] r_noise_flag_arr;
	delete[] lead_data;
	delete[] t_pos_arr;
	delete[] p_pos_arr;
	delete[] start_end_arr;
	delete[] rr_noise_levels;


}


